package com.yeadun.testutil.product.model;import java.util.HashMap;public class P100047 implements Product{    private String crimeType;    private String caseType;    private String caseTime;    private String caseSource;    @Override    public HashMap<String, String> pojo2Map() {        HashMap<String, String > result = new HashMap<>();        result.put("crimeType", this.crimeType);        result.put("caseType", this.caseType);        result.put("caseTime", this.caseTime);        result.put("caseSource", this.caseSource);        return result;    }    public String toString(){        return "crimeType - " + crimeType + ", caseType - " + caseType + ",caseTime - " + caseTime + ",caseSource - " + caseSource + ".";    }    public String getCrimeType() {        return crimeType;    }    public void setCrimeType(String crimeType) {        this.crimeType = crimeType;    }    public String getCaseType() {        return caseType;    }    public void setCaseType(String caseType) {        this.caseType = caseType;    }    public String getCaseTime() {        return caseTime;    }    public void setCaseTime(String caseTime) {        this.caseTime = caseTime;    }    public String getCaseSource() {        return caseSource;    }    public void setCaseSource(String caseSource) {        this.caseSource = caseSource;    }}